import React, {Component} from 'react';
import Header from './header';
import Footer from './footer';

const generateQuiz = ({props}) => {
    return (
        <div className="row">
            This is our test
        </div>
    )
}

class Test extends Component {
    constructor (props) {
        super (props);
        this.state = {
            data: ''
        }
    }

    render() {
        return (
            <div>
                <Header />
                {generateQuiz(this.props)}
                <Footer />
            </div>
        )
    }
}

export default Test;
